import React, { Component } from "react";
import { connect } from "react-redux";
import "../style/suggestions-friend-list.css";
function mapStateToProps(state) {
  return {};
}

class FriendsSuggestionsList extends Component {
  render() {
    return (
      <div class="container bootstrap snippet">
        <div class="social-cover"></div>
        <div class="social-desc">
          <div class="visible-md visible-sm">
            <h1 class="fg-white">Empire State, NY, USA</h1>
            <h5 class="fg-white">- Aug 20th, 2014</h5>
            <div style={{ "margin-top": "10px" }} />
          </div>
        </div>
        <div class="social-avatar" >
        <img class="img-avatar" src="https://bootdey.com/img/Content/user-453533-fdadfd.png" height="10" width="10" alt="logo"/>
        <h4 class="fg-white text-center">Marting lowenyert</h4>
        <h5 class="fg-white text-center" style={{"opacity":"0.8"}}>DevOps Engineer, NY</h5>
        <hr class="border-black75" style={{"border-width":"2px;"}}/>

        </div>
      </div>
    );
  }
}

export default connect(mapStateToProps)(FriendsSuggestionsList);
